import {TopBar} from "./App";
import './homePage.css';
import Card from 'react-bootstrap/Card';
import Accordion from 'react-bootstrap/Accordion';


const Voice = () => {
  return (
      <>
          <TopBar />
          <div style={{ position: 'relative' }}>
              <Card style={{ width: '400px', height:'200px', position: 'absolute', top: '15%', left: '50%', transform: 'translateX(-50%)'}}>
                  <Card.Img src="src/logo.svg" />
              </Card>
              <Accordion defaultActiveKey={['0']} alwaysOpen style={{ position: 'absolute', top: '100%', left: '50%', transform: 'translateX(-50%)' }}>
                  <Accordion.Item eventKey="0">
                      <Accordion.Header>Accordion Item #1</Accordion.Header>
                      <Accordion.Body>
                      1
                      </Accordion.Body>
                  </Accordion.Item>
                  <Accordion.Item eventKey="1">
                      <Accordion.Header>Accordion Item #2</Accordion.Header>
                      <Accordion.Body>
                      2
                      </Accordion.Body>
                  </Accordion.Item>
              </Accordion>
          </div>
      </>
  );
}
export default Voice;
